//import RegisterForm from './components/RegisterForm';
//import Dashboard from './components/Dashboard';
import './App.css';

function App() {
  return (
    <Router>
       <div className="root">
       </div>
      <Routes>
        <LoginForm/>
        </Routes>
    </Router>
  );
}

export default App;
